import React from 'react';
import logo from './logo.svg';
import './App.css';
import Videos from './components/videos/videos'

function App() {
  return (
    <div className="App">
      <header id='header'>Youtube Channel API</header>
      <QueryForm/>
      <Videos/>
    </div>
  );
}

class QueryForm extends React.Component {
  SubmitHandler = (event) => {
    event.preventDefault();
    alert("You are submitting");
  }

  render() {
    return (
      <form onSubmit={this.SubmitHandler}>>
        <h1>Specify Search Results:</h1>
        <p>Channel: <input id="channel" type="text"/></p>
        <p>Number of Videos: <input id="maxResults" type="text"/></p>
        <p>Key Terms: <input id="keyTerms" type="text"/></p>
        <a></a>
        <input type='submit'/>
      </form>
    );
  }
}

export default App;
